<?php

declare(strict_types=1);

namespace Tests;

use Exception;
use InvalidArgumentException;
use PHPUnit\Framework\TestCase;
use Yousign\YousignClient;

class ProcedureTest extends TestCase
{
    use TestInit;

    /**
     * Tests that a client can post a not started procedure via API call
     * @return void
     */
    public function test_client_can_post_unstarted_procedure()
    {
        $config = [
            'api_url' => self::$stagingApiUrl,
            'api_key' => self::$stagingApiKey
        ];
        $yousignClient = new YousignClient($config);

        $procedure = $yousignClient->postProcedure(
            $name = 'My procedure',
            $description = '',
            $start = false
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);
        $this->assertObjectHasAttribute('members', $procedure);

        $this->assertTrue($procedure->status == 'draft');
        $this->assertTrue($procedure->members == []);
    }

    /**
     * Tests that a client can post a started procedure via API call
     * @return void
     */
    public function test_client_can_post_started_procedure()
    {
        $config = [
            'api_url' => self::$stagingApiUrl,
            'api_key' => self::$stagingApiKey
        ];
        $yousignClient = new YousignClient($config);

        // File
        $file = $yousignClient->postFile(
            $name = 'MyTestFile.pdf',
            $content = '',
            $type = 'signable'
        );

        $this->assertObjectHasAttribute('id', $file);

        // File object
        $fileObject = [
            'file' => $file->id,
            'page' => 1,
            'position' => '0,0,200,100',
            'reason' => 'Signed by someone with Yousign'
        ];

        // User
        $user = [
            'firstname' => $this->fakerFirstName(),
            'lastname' => $this->fakerLastName(),
            'email' => $this->fakerEmail(),
            'phone' => $this->fakerPhone()
        ];
        $user[ 'fileObjects' ] = [ $fileObject ];

        // Procedure
        $procedure = $yousignClient->postProcedure(
            $name = 'My procedure',
            $description = '',
            $start = true,
            $members = [ $user ]
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);
        $this->assertObjectHasAttribute('members', $procedure);

        $this->assertTrue($procedure->status == 'active');
    }

    /**
     * Tests that a client can put a procedure via API call
     * @return void
     */
    public function test_client_can_put_procedure()
    {
        $config = [
            'api_url' => self::$stagingApiUrl,
            'api_key' => self::$stagingApiKey
        ];
        $yousignClient = new YousignClient($config);

        // File
        $file = $yousignClient->postFile(
            $name = 'MyTestFile.pdf',
            $content = '',
            $type = 'signable'
        );

        $this->assertObjectHasAttribute('id', $file);

        // File object
        $fileObject = [
            'file' => $file->id,
            'page' => 1,
            'position' => '0,0,200,100',
            'reason' => 'Signed by someone with Yousign'
        ];

        // User
        $user = [
            'firstname' => $this->fakerFirstName(),
            'lastname' => $this->fakerLastName(),
            'email' => $this->fakerEmail(),
            'phone' => $this->fakerPhone()
        ];
        $user[ 'fileObjects' ] = [ $fileObject ];

        // Procedure
        $procedure = $yousignClient->postProcedure(
            $name = 'My procedure',
            $description = '',
            $start = false
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);

        $this->assertTrue($procedure->name == $name);
        $this->assertTrue($procedure->description == $description);
        $this->assertCount(0, $procedure->members);
        $this->assertTrue($procedure->status == 'draft');

        // Rcupration de l'id de la procdure
        preg_match(YousignClient::UUID_REGEX, $procedure->id, $matches);
        $procedureId = $matches[ 0 ];

        // Procedure
        $procedure = $yousignClient->putProcedure(
            $id = $procedureId,
            $name = 'My updated procedure',
            $description = 'Updated description of my procedure',
            $start = false,
            $members = [ $user ]
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);

        $this->assertTrue($procedure->name == $name);
        $this->assertTrue($procedure->description == $description);
        $this->assertCount(1, $procedure->members);

        // Procedure
        $procedure = $yousignClient->putProcedure(
            $id = $procedureId,
            $name = null,
            $description = null,
            $start = true
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);

        $this->assertTrue($procedure->status == 'active');
    }

    /**
     * Tests that a client can delete a procedure via API call
     * @return void
     */
    public function test_client_can_delete_procedure()
    {
        $config = [
            'api_url' => self::$stagingApiUrl,
            'api_key' => self::$stagingApiKey
        ];
        $yousignClient = new YousignClient($config);

        // Procedure
        $procedure = $yousignClient->postProcedure(
            $name = 'My procedure',
            $description = 'Description of my procedure',
            $start = false
        );

        preg_match(YousignClient::UUID_REGEX, $procedure->id, $matches);
        $id = $matches[ 0 ];
        
        $response = $yousignClient->deleteProcedure(
            $id = $id
        );

        $this->assertTrue($response == null);
    }

    /**
     * Tests that a client can get a procedure via API call
     * @return void
     */
    public function test_client_can_get_procedure()
    {
        $config = [
            'api_url' => self::$stagingApiUrl,
            'api_key' => self::$stagingApiKey
        ];
        $yousignClient = new YousignClient($config);

        // Procedure
        $procedure = $yousignClient->postProcedure(
            $name = 'My procedure',
            $description = 'Description of my procedure',
            $start = false
        );

        $this->assertObjectHasAttribute('id', $procedure);

        preg_match(YousignClient::UUID_REGEX, $procedure->id, $matches);
        $id = $matches[ 0 ];

        // Procedure
        $procedure = $yousignClient->getProcedure(
            $id = $id
        );

        $this->assertObjectHasAttribute('id', $procedure);
        $this->assertObjectHasAttribute('name', $procedure);
        $this->assertObjectHasAttribute('description', $procedure);
        $this->assertObjectHasAttribute('status', $procedure);

        $this->assertTrue($procedure->name == $name);
        $this->assertTrue($procedure->description == $description);
        $this->assertCount(0, $procedure->members);
    }
}
